  `transaction_amount` double unsigned NOT NULL DEFAULT '0',
  `transaction_tips` double unsigned NOT NULL DEFAULT '0',
  `transaction_merchant_note` varchar(255) NOT NULL DEFAULT '',
  `transaction_user_note` varchar(255) NOT NULL DEFAULT '',
  `transaction_paid` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `transaction_cancelled` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `transaction_flagged` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `transaction_cancelled_reason` varchar(100) DEFAULT NULL,
  `transaction_deleted` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `transaction_datetime_requested` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `transaction_datetime_paid` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `transaction_location` tinyint(1) unsigned DEFAULT '0',
  `transaction_latitude` decimal(10,7) DEFAULT NULL,
  `transaction_longitude` decimal(10,7) DEFAULT NULL,
  PRIMARY KEY (`transaction_id`),
  KEY `account_id` (`account_id`),
  KEY `merchant_id` (`merchant_id`),
  KEY `user_id` (`user_id`)
